// Team.js
import React, { useState } from 'react';
import { Container, Typography, Card, CardContent } from '@mui/material';
import './Team.css'; // Import the CSS file
import FooterMenu from '../Footer.jsx';

const Team = () => {
  const [teamData, setTeamData] = useState({
    registeredMembers: 0,
    validMembers: 0,
    teamIncome: 0.00,
    generations: [
      {
        percentage: 18,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 6,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
      {
        percentage: 3,
        teamCommission: 0,
        registeredMembers: 0,
        validMembers: 0,
        teamIncome: 0.00,
      },
    ],
  });

  return (
    <div className="page-container">
      <Container maxWidth="lg" className="page-content">
        <Typography variant="h4" className="page-title">
          My Team
        </Typography>

        {/* Team Data Overview */}
        <div className="overview-card">
          <div className="overview-item">
            <h3>Registered Members</h3>
            <p>{teamData.registeredMembers}</p>
          </div>
          <div className="overview-item">
            <h3>Valid Members</h3>
            <p>{teamData.validMembers}</p>
          </div>
          <div className="overview-item">
            <h3>Team Income</h3>
            <p>${teamData.teamIncome.toFixed(2)}</p>
          </div>
        </div>

        {/* Generations Data */}
        <Typography variant="h6" className="page-title">
          The Last Three Generations of Data
        </Typography>
        <div className="generations-container">
          {teamData.generations.map((generation, index) => (
            <Card key={index} className="generation-card">
              <CardContent>
                <Typography variant="h6">{`Generation ${index + 1}`}</Typography>
                <Typography variant="body1">Percentage: {generation.percentage}%</Typography>
                <Typography variant="body1">Team Commission: ${generation.teamCommission}</Typography>
                <Typography variant="body1">Registered Members: {generation.registeredMembers}</Typography>
                <Typography variant="body1">Valid Members: {generation.validMembers}</Typography>
                <Typography variant="body1">Team Income: ${generation.teamIncome.toFixed(2)}</Typography>
              </CardContent>
            </Card>
          ))}
        </div>
      </Container>

      {/* Footer */}
      <FooterMenu />
    </div>
  );
};

export default Team;
